(1, 2, '10 Food Items you Should Instantly Remove From your Diet for Weight Loss', '7U7po4hoZTC5pSIJ_image-24-696x391.png', '<p>Wouldn&rsquo;t it be great if we all could eat to our heart&rsquo;s desire, indulge in a super rich chocolate cake, munch on an infinite supply of french fries all without the fear of gaining weight? This could only happen in a perfect world. But sadly for us calories are very real and weight gain is a T-Rex we all want to avoid.</p>\r\n<p>In recent years, it has been very encouraging to see that a lot of Pakistani people are now opting for a healthier lifestyle by making smart food choices and exercising regularly. If you happen to be someone who is desperately trying to lose weight then you would want to read through this entire post. Today we&rsquo;ll be talking about some popular food items &ndash; most of which seem to be healthy &ndash; but actually, contribute to weight gain. However, we&rsquo;re not completely heartless. So when we ask you to remove the following food items from your diet we&rsquo;ll also be suggesting a&nbsp;<a href=\"https://www.myzindagi.pk/blog/weight-loss-tips/04-weight-loose/\">weight loss</a>&nbsp;friendly alternative. Read on to find more!</p>\r\n<h3>1. French Fries</h3>\r\n<p><img class=\"size-medium wp-image-344 alignleft td-animation-stack-type0-1\" src=\"https://www.myzindagi.pk/blog/wp-content/uploads/2017/07/image-23-300x169.png\" sizes=\"(max-width: 300px) 100vw, 300px\" srcset=\"https://www.myzindagi.pk/blog/wp-content/uploads/2017/07/image-23-300x169.png 300w, https://www.myzindagi.pk/blog/wp-content/uploads/2017/07/image-23-768x432.png 768w, https://www.myzindagi.pk/blog/wp-content/uploads/2017/07/image-23-696x392.png 696w, https://www.myzindagi.pk/blog/wp-content/uploads/2017/07/image-23-746x420.png 746w, https://www.myzindagi.pk/blog/wp-content/uploads/2017/07/image-23.png 876w\" alt=\"\" width=\"300\" height=\"169\" />We feel it&rsquo;s an understood fact that everyone loves french fries. They are ridiculously tasty and so you end up eating more than you should. It wouldn&rsquo;t be such a bad thing if potato chips weren&rsquo;t fried in tonnes of oil. And oil as we know raises your cholesterol level which is one of the several&nbsp;<a href=\"https://www.myzindagi.pk/blog/8-ordinary-things-can-lead-heart-attack/\">reasons that cause a heart attack</a>. So you will have to master some self-restraint and with a heavy heart eat french fries as scarcely as possible because we understand it&rsquo;s impossible to give them up completely. Also try to avoid processed potato chips because they are high on oil content too. A healthier alternative in this case would be potato chips made in an air fryer which uses a few tablespoon worth of oil. Or you could steam potatoes which is probably the healthiest choice you could make!</p>\r\n<h3>2. Chocolate</h3>\r\n<p><img class=\"size-medium wp-image-343 alignleft td-animation-stack-type0-1\" src=\"https://www.myzindagi.pk/blog/wp-content/uploads/2017/07/image-22-300x168.png\" sizes=\"(max-width: 300px) 100vw, 300px\" srcset=\"https://www.myzindagi.pk/blog/wp-content/uploads/2017/07/image-22-300x168.png 300w, https://www.myzindagi.pk/blog/wp-content/uploads/2017/07/image-22.png 625w\" alt=\"\" width=\"300\" height=\"168\" />Chocolate is considered a great option for people suffering from&nbsp;<a href=\"https://www.myzindagi.pk/cities/lahore/cardiologist-heart-specialist/disease/congestive-heart-disease\">heart diseases</a>. It contains disease-fighting polyphenols and it has also been linked to weight loss. But the important thing to understand here is that chocolate will only have beneficial effects if eaten in moderation otherwise you&rsquo;ll just be packing on saturated fat and sugar. We recommend eating small amounts of dark chocolate which contains higher content of cocoa and will be less sugary.</p>\r\n<blockquote>\r\n<p>ALSO READ:&nbsp;<a title=\"5 Ways To Lose Weight Without Even Trying\" href=\"https://www.myzindagi.pk/blog/5-ways-lose-weight-without-even-trying/\" rel=\"bookmark\">5 WAYS TO LOSE WEIGHT WITHOUT EVEN TRYING</a></p>\r\n</blockquote>\r\n<h3>3. Cheese</h3>\r\n<p><img class=\"size-medium wp-image-342 alignleft td-animation-stack-type0-1\" src=\"https://www.myzindagi.pk/blog/wp-content/uploads/2017/07/image-21-300x200.png\" sizes=\"(max-width: 300px) 100vw, 300px\" srcset=\"https://www.myzindagi.pk/blog/wp-content/uploads/2017/07/image-21-300x200.png 300w, https://www.myzindagi.pk/blog/wp-content/uploads/2017/07/image-21-768x512.png 768w, https://www.myzindagi.pk/blog/wp-content/uploads/2017/07/image-21-696x464.png 696w, https://www.myzindagi.pk/blog/wp-content/uploads/2017/07/image-21-630x420.png 630w, https://www.myzindagi.pk/blog/wp-content/uploads/2017/07/image-21.png 1000w\" alt=\"\" width=\"300\" height=\"200\" />Cheese makes everything better except when you&rsquo;re on a&nbsp;<a href=\"https://www.myzindagi.pk/blog/weight-loss-tips/\">mission to lose weight</a>. It&rsquo;s a healthy food item and is packed with calcium and protein but that also comes with an excess baggage of fats and some unwanted calories. Cheese is a good option for growing kids but the older you get the more you should distance yourself from cheese particular more fattening types like Cheddar or Mozzarella. If you can get your hands on low-fat versions like Goat, Feta, and Cottage cheese then we&rsquo;d highly recommend that.</p>\r\n<h3>4. Milk</h3>\r\n<p><img class=\"size-medium wp-image-341 alignleft td-animation-stack-type0-1\" src=\"https://www.myzindagi.pk/blog/wp-content/uploads/2017/07/image-20-300x183.png\" sizes=\"(max-width: 300px) 100vw, 300px\" srcset=\"https://www.myzindagi.pk/blog/wp-content/uploads/2017/07/image-20-300x183.png 300w, https://www.myzindagi.pk/blog/wp-content/uploads/2017/07/image-20-768x469.png 768w, https://www.myzindagi.pk/blog/wp-content/uploads/2017/07/image-20-696x425.png 696w, https://www.myzindagi.pk/blog/wp-content/uploads/2017/07/image-20-687x420.png 687w, https://www.myzindagi.pk/blog/wp-content/uploads/2017/07/image-20.png 900w\" alt=\"\" width=\"300\" height=\"183\" />Milk is the healthiest food item out there. It&rsquo;s filled with Vitamin A, Vitamin D, Calcium, and Protein but it&rsquo;ll pack on the pounds if you&rsquo;re opting for whole fat milk. One glass of whole milk contains roughly 150 calories and 8 grams of fat. But if you opt for skimmed or low-fat milk you&rsquo;ll automatically be cutting down on 70 calories. It will still taste the same and you want to pick food items that will help lose weight. So next time you go grocery shopping go for non-fat or low-fat milk.</p>\r\n<h3>5. Nuts</h3>\r\n<p><img class=\"size-medium wp-image-340 alignleft td-animation-stack-type0-1\" src=\"https://www.myzindagi.pk/blog/wp-content/uploads/2017/07/image-19-300x200.png\" sizes=\"(max-width: 300px) 100vw, 300px\" srcset=\"https://www.myzindagi.pk/blog/wp-content/uploads/2017/07/image-19-300x200.png 300w, https://www.myzindagi.pk/blog/wp-content/uploads/2017/07/image-19-696x465.png 696w, https://www.myzindagi.pk/blog/wp-content/uploads/2017/07/image-19-629x420.png 629w, https://www.myzindagi.pk/blog/wp-content/uploads/2017/07/image-19.png 737w\" alt=\"\" width=\"300\" height=\"200\" />Nuts like almonds are a very healthy snack. But if you start chomping them up like popcorn they will turn into a case of good gone bad. Nuts in small amounts are very healthy for you, they are high on proteins and heart-healthy fats. But while eating them make sure you go for more healthy options like almonds, pistachios, and cashew nuts as opposed to walnuts or macadamia nuts. Another thing to remember here would be to not eat straight from the jar. Measure about a quarter cup of nuts and that should be enough calories for you.</p>', '1', '2018-04-06 06:29:22', '2018-04-06 06:43:55'),
(2, 2, 'These are the leading causes of death in Pakistan', 'ts2005RHHLEFetxm_image-65-696x464.png', '<p>Pakistan is the 6th most populous country in the world with an estimated population of 200 million. However, Pakistan&rsquo;s status as a developing country means that some important things have to take the back seat. Based on a 2013 survey it was found that the government only spends roughly 2.8% of the GDP on healthcare.</p>\r\n<p>Healthcare in Pakistan is not really the best in the world. And if someone happens to be a little under-privileged, it can become even more difficult to get access to the best doctors. This is a major contributing factor to Pakistan&rsquo;s high mortality rate. Earlier this year, Center for Disease Control, also known as CDC Global, released a detailed report on health in Pakistan. According to this report, life expectancy for men and women is 66 and 67 years respectively. While the infant mortality rate is the highest in Pakistan.</p>\r\n<p>World Life Expectancy constantly updates their database with the leading reasons of deaths in a country and based on their information, here is a look at the top 10 causes of death in Pakistan.</p>\r\n<h2>1. Coronary Heart Disease</h2>\r\n<p>Coronary Heart Diseases (CHD) occur when a waxy substance builds up inside the coronary arteries and blocks the flow of oxygen rich blood to the heart and in many cases this leads to a heart attack. CHD is one of the top causes of deaths in Pakistan and every year about 9.87% of deaths are caused due to it taking the tally of total deaths up to 111,367.&nbsp;<a href=\"https://www.myzindagi.pk/blog/8-ordinary-things-can-lead-heart-attack/\">Read more</a>&nbsp;to find the ordinary things that can cause a heart attack.</p>\r\n<h2>2. Influenza and Pneumonia</h2>\r\n<p>You would think that influenza and pneumonia are not life-threatening diseases but in Pakistan about 9.26% of deaths are caused due to it. Mostly people who don&rsquo;t have access to clean and proper medical facilities fall prey to influenza and pneumonia. Of the 104,458 who die to to these diseases most of them are young children.</p>\r\n<h2>3. Stroke</h2>\r\n<p>A stroke is caused when the supply of oxygenated blood to the brain is cut off. This may be due to a blocked artery or a ruptured blood vessel. This deprives your brain of oxygen and other nutrients and can cause your brain cells to die. In case of a stroke immediate medical attention is needed otherwise it may lead to unrecoverable damage or even death. 7.5% deaths are caused due to a stroke each year.</p>\r\n<h2>4. Low Birth Weight</h2>\r\n<p>The weight of an average newborn is 8 pounds. However, there are numerous children across Pakistan who are born with a low birth weight of about 5 pounds, 8 ounces. In such a case, infants need a lot of care and attention which hospitals in Pakistan lag. About 77,000 new born children die due to a low birth weight every year.</p>\r\n<h2>5. Diarrhoeal Diseases</h2>\r\n<p>Diarrhoeal diseases are a leading cause of death in young children particularly those who live in unhygienic conditions, drink unclean water, and don&rsquo;t have access to proper medical care. Globally, there are 1.7 billion reported cases of diarrhoeal diseases and kills about 525,000 children under five. In Pakistan, over 60,000 children die due to these diseases.</p>\r\n<h2>6. Lung Disease</h2>\r\n<p>There are multiple types of lung diseases which include asthma, bronchitis, cystic fibrosis, and chronic obstructive pulmonary disease and several others. In Pakistan about 5.46% of deaths are caused due to various lung diseases.</p>\r\n<h2>7. Tuberculosis</h2>\r\n<p>Tuberculosis has plagued mankind since ancient times. Despite the fact that the number has reduced over the years, the number of reported cases and eventual deaths due to TB are still very high in developing countries. About 80% people test positive for TB in Asia and Africa. In Pakistan alone, over 60,000 people die due to tuberculosis every year.</p>\r\n<h2>8. Birth Trauma</h2>\r\n<p>Birth Trauma or BT refers to the damage caused to the tissues and organs of a newborn due to physical pressure or trauma during childbirth. This often results in lifelong consequences of a cognitive nature due to damage caused to the brain. In Pakistan, there are over 52,000 reported cases of birth trauma per year.</p>\r\n<h2>9. Accidents &amp; Other Injuries</h2>\r\n<p>Accidents and other serious injuries lead to death more often than we think. 4.27% of total deaths in Pakistan are caused due to injuries sustained during violent accidents.</p>\r\n<h2>10. Diabetes Mellitus</h2>\r\n<p>Diabetes essentially affects your body&rsquo;s ability to use the energy present in the food being eaten. There is type 1 and type 2 diabetes and gestational diabetes. Over 40,000 deaths are caused due to diabetes in Pakistan.</p>', '1', '2018-04-06 06:31:16', '2018-04-06 06:43:55'),
(3, 2, 'Schizophrenia: Matters of the Mind', '2X5wptHXxyUI3hdL_02-Schizophrenia-696x465.png', '<p>While body ailments are often at the forefront of our worries, we often take our mental health for granted. We don&rsquo;t realize the power our mind holds and how terrifying a mental disorder can be. It is comparatively easy to share feelings about a physical handicap or injury. But disorders such as depression, anxiety, or schizophrenia can be very hard to express because they are not visible and uniquely affect an individual.</p>\r\n<h2>What is Schizophrenia?</h2>\r\n<p>Schizophrenia is a severe mental disorder that alters the way a person behaves, thinks and feels. About&nbsp;<a href=\"http://www.isps-us.org/articles/pakistan.htm\" rel=\"nofollow\">1.5% of Pakistan&rsquo;s population</a>&nbsp;is suffering from this disease that occurs equally in both male and females. Globally, it affects about 1 in every 100 people and is known to usually start during early adulthood, most often between the ages of 16 and 30.</p>\r\n<h3>Schizophrenia Symptoms:</h3>\r\n<p>The schizophrenia symptoms fall into three categories. These include positive, negative, and cognitive symptoms. Positive symptoms include hallucinations, delusions, and dysfunctional ways of thinking. Negative symptoms on the other hand are associated more with depression and withdrawals. A person suffering from negative symptoms may have difficulty beginning and continuing activities and communicates very little.</p>\r\n<p>Cognitive schizophrenia symptoms make it hard to focus or pay attention.</p>\r\n<p>&nbsp;</p>\r\n<h2>Types of Schizophrenia:</h2>\r\n<ul>\r\n<li><strong>Paranoid schizophrenia</strong></li>\r\n</ul>\r\n<p>This is usually the most common form of schizophrenia, where a person suffers from hallucinations and/or delusions.</p>\r\n<ul>\r\n<li><strong>Hebephrenic schizophrenia</strong></li>\r\n</ul>\r\n<p>In this condition, behaviour is disorganised and unnecessary giggling, laughing etc. are common occurrences.</p>\r\n<ul>\r\n<li><strong>Catatonic schizophrenia</strong></li>\r\n</ul>\r\n<p>This form of illness is more rare. A person suffering from this may not speak at all and behaviour may switch between extremes of over-activity and stillness.</p>\r\n<ul>\r\n<li><strong>Undifferentiated schizophrenia</strong></li>\r\n</ul>\r\n<p>Here, the illness may have some characteristics of paranoid, hebephrenic or catatonic schizophrenia, but does not fit one of these specific types.</p>\r\n<ul>\r\n<li><strong>Residual schizophrenia</strong></li>\r\n</ul>\r\n<p>A person may be diagnosed with this if they have a history of psychosis but only have negative symptoms.</p>\r\n<ul>\r\n<li><strong>Simple schizophrenia</strong></li>\r\n</ul>\r\n<p>Negative symptoms are prominent early and get worse quickly, while positive symptoms are rare.</p>\r\n<ul>\r\n<li><strong>Other, including &lsquo;cenesthopathic&rsquo; schizophrenia</strong></li>\r\n</ul>\r\n<p>This is usually described for a person who displays traits not covered by other categories.&nbsp;For example, in cenesthopathic schizophrenia, people experience unusual bodily sensations.</p>\r\n<h2>What causes this?</h2>\r\n<p>According to studies, one of the factors causing schizophrenia may be genetic. If one of the parents is afflicted with schizophrenia, there is a 13% chance for a child to contract the disorder.</p>\r\n<p>Other than that, social adversity, trauma, family dysfunction and drug abuse are also known to contribute towards this mental illness.</p>\r\n<p><strong>How can schizophrenia be treated?</strong></p>\r\n<p>Although there exists no medical test to determine exactly what changes are occurring through the mind, going through any of the schizophrenia symptoms mentioned above warrant professional help? Upon determining a patient&rsquo;s mental condition, a treatment plan is suggested by the doctor. This can either be psychological therapy or medication.</p>\r\n<p>Psychological therapy offers &lsquo;talking treatments&rsquo; along with learning various coping skills to face challenges brought about by schizophrenia.</p>\r\n<p>Medication involves the use of &lsquo;antipsychotics&rsquo;, which are meant to decrease the schizophrenia symptoms. Up to 3 in 10 people with schizophrenia may have a lasting recovery, and 1 in 5 people may show significant improvement.</p>\r\n<p>Promoting awareness and understanding this condition will allow diagnosis and treatment to take place quicker. A healthy mind is a gift that should not be taken for granted. If you feel you are suffering from a mental disorder, seek help from a health professional immediately instead of fighting this battle alone.</p>\r\n<p>While body ailments are often at the forefront of our worries, we often take our mental health for granted. We don&rsquo;t realize the power our mind holds and how terrifying a mental disorder can be. It is comparatively easy to share feelings about a physical handicap or injury. But disorders such as depression, anxiety, or schizophrenia can be very hard to express because they are not visible and uniquely affect an individual.</p>\r\n<h2>What is Schizophrenia?</h2>\r\n<p>Schizophrenia is a severe mental disorder that alters the way a person behaves, thinks and feels. About&nbsp;<a href=\"http://www.isps-us.org/articles/pakistan.htm\" rel=\"nofollow\">1.5% of Pakistan&rsquo;s population</a>&nbsp;is suffering from this disease that occurs equally in both male and females. Globally, it affects about 1 in every 100 people and is known to usually start during early adulthood, most often between the ages of 16 and 30.</p>\r\n<h3>Schizophrenia Symptoms:</h3>\r\n<p>The schizophrenia symptoms fall into three categories. These include positive, negative, and cognitive symptoms. Positive symptoms include hallucinations, delusions, and dysfunctional ways of thinking. Negative symptoms on the other hand are associated more with depression and withdrawals. A person suffering from negative symptoms