t, social adversity, trauma, family dysfunction and drug abuse are also known to contribute towards this mental illness.</p>\r\n<p><strong>How can schizophrenia be treated?</strong></p>\r\n<p>Although there exists no medical test to determine exactly what changes are occurring through the mind, going through any of the schizophrenia symptoms mentioned above warrant professional help? Upon determining a patient&rsquo;s mental condition, a treatment plan is suggested by the doctor. This can either be psychological therapy or medication.</p>\r\n<p>Psychological therapy offers &lsquo;talking treatments&rsquo; along with learning various coping skills to face challenges brought about by schizophrenia.</p>\r\n<p>Medication involves the use of &lsquo;antipsychotics&rsquo;, which are meant to decrease the schizophrenia symptoms. Up to 3 in 10 people with schizophrenia may have a lasting recovery, and 1 in 5 people may show significant improvement.</p>\r\n<p>Promoting awareness and understanding this condition will allow diagnosis and treatment to take place quicker. A healthy mind is a gift that should not be taken for granted. If you feel you are suffering from a mental disorder, seek help from a health professional immediately instead of fighting this battle alone.</p>', '1', '2018-04-06 06:32:32', '2018-04-06 06:43:55'),
(4, 2, '10 Essentials of Taking Care of Yourself After a C-Section', 'Hs7DL72ynR2Eds0E_Mom-health-1.jpg', '<p>Childbirth is a painfully beautiful moment that every pregnant mother awaits. Having to finally see her infant after a long wait of 9 months is one of the greatest moments of a mother&rsquo;s life. Despite the joy, childbirth greatly exhausts a mother&rsquo;s body, especially in case of a C-section (cesarean) delivery.</p>\r\n<h3><strong>Health-care of the Mother is Crucial after</strong><strong>&nbsp;Delivery:</strong></h3>\r\n<p>It&rsquo;s critical for every mother to have enough recovery time in her postpartum period (the days following childbirth) because the maternal mortality rate is highest in the postpartum period. So special attention must be given to mother&rsquo;s care and well-being. Staying under the consultation of an experienced gynecologist is mandatory during this period. Choose the&nbsp;<a href=\"https://www.marham.pk/doctors/karachi/gynecologist\">best gynecologist in Karachi</a><strong>,</strong>&nbsp;Lahore or any other main city of Pakistan via Marham.pk.</p>\r\n<p>Cesarean delivery takes longer to recover compared to that of a normal vaginal delivery. After any kind of delivery, the mother should not be subjected to any physical or emotional load. Sufficient rest and partner&rsquo;s support are the keys to a speedy recovery.</p>\r\n<p>Here are some effective suggestions that will help you to recover after a C-section so that you will have less time feeling painful and exhausted, and more time to bond with your baby.<br /><img class=\"alignnone size-full wp-image-8676\" src=\"https://i2.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/Mom-health-3.jpg?resize=950%2C499&amp;ssl=1\" sizes=\"(max-width: 950px) 100vw, 950px\" srcset=\"https://i2.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/Mom-health-3.jpg?w=1200&amp;ssl=1 1200w, https://i2.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/Mom-health-3.jpg?resize=400%2C210&amp;ssl=1 400w, https://i2.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/Mom-health-3.jpg?resize=300%2C158&amp;ssl=1 300w, https://i2.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/Mom-health-3.jpg?resize=768%2C403&amp;ssl=1 768w, https://i2.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/Mom-health-3.jpg?resize=1024%2C538&amp;ssl=1 1024w\" alt=\"postpartum well being\" width=\"764\" height=\"401\" data-attachment-id=\"8676\" data-permalink=\"https://www.marham.pk/healthblog/10-essentials-taking-care-yourself-after-c-section/mom-health-3/\" data-orig-file=\"https://i2.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/Mom-health-3.jpg?fit=1200%2C630&amp;ssl=1\" data-orig-size=\"1200,630\" data-comments-opened=\"0\" data-image-meta=\"{&quot;aperture&quot;:&quot;0&quot;,&quot;credit&quot;:&quot;&quot;,&quot;camera&quot;:&quot;&quot;,&quot;caption&quot;:&quot;&quot;,&quot;created_timestamp&quot;:&quot;0&quot;,&quot;copyright&quot;:&quot;&quot;,&quot;focal_length&quot;:&quot;0&quot;,&quot;iso&quot;:&quot;0&quot;,&quot;shutter_speed&quot;:&quot;0&quot;,&quot;title&quot;:&quot;&quot;,&quot;orientation&quot;:&quot;0&quot;}\" data-image-title=\"Mom-health-3\" data-image-description=\"\" data-medium-file=\"https://i2.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/Mom-health-3.jpg?fit=300%2C158&amp;ssl=1\" data-large-file=\"https://i2.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/Mom-health-3.jpg?fit=950%2C499&amp;ssl=1\" /></p>\r\n<h3><strong>10 T</strong><strong>ips and Suggestions for a Speedy Recovery:</strong></h3>\r\n<p><strong>1.&nbsp;</strong><a href=\"https://www.marham.pk/healthblog/c-sections-completely-safe-not/\">C-section</a>&nbsp;is a major surgery, and like any other major surgeries, it takes time to heal. You should expect a delay of 3-4 days (longer in case of complications) before your discharge from the hospital. It will take about 6-8 weeks for the incision to completely heal.</p>\r\n<p><strong>2.&nbsp;</strong>You will be encouraged to go to the bathroom within the first 24 hours of surgery. It will help you to become accustomed to moving around with your incision. Remember to move slowly because you might become dizzy or breathless.</p>\r\n<p><strong>3.&nbsp;</strong>If you want to use medication for your pain relief, get a prescription and information about its side-effects for both yourself and your child.</p>\r\n<p><strong>4.</strong><strong>&nbsp;</strong>When your uterus begins involution<strong>&nbsp;</strong>(shrinking of the uterus to its pre-pregnancy size), you will experience heavy bleeding which is called&nbsp;<strong>lochia</strong>. It can continue for 6 weeks. You will need to have menstrual pads with extra absorbing capacity. Don&rsquo;t use tampons during this time.</p>\r\n<p><strong>5.</strong><strong>&nbsp;</strong>After your discharge, you should avoid lifting heavy objects and most of the household work. Keep your activity level fairly low and take plenty of rest to speed up your healing process.</p>\r\n<p><strong>6</strong><strong>.&nbsp;</strong>Keep your body properly hydrated and make sure to eat nutrient-rich and fiber-rich foods to restore your energy and prevent constipation.</p>\r\n<p><strong>7</strong><strong>.&nbsp;</strong>Be vigilant of any fever or pain which can indicate the development of an infection.</p>\r\n<p><strong>8</strong><strong>.&nbsp;</strong>Avoid any kind of strenuous exercise but do take gentle walks as often as you can.</p>\r\n<p><strong>9</strong><strong>.</strong><strong>&nbsp;</strong>Make sure you get an adequate sleep because sleep helps in repairing and healing the body damages. With an infant at hand, it seems almost impossible but you can time your naps with that of your baby&rsquo;s. Sleep whenever your baby sleeps.</p>\r\n<p><strong>10.</strong><strong>&nbsp;</strong>Your emotional health is as important as your physical health. Consult your partner, a counselor, or a doctor if you&rsquo;re feeling distressed or overwhelmed in any way. Marham can help you&nbsp;<a href=\"https://www.marham.pk/doctors/karachi/psychologist\">book an appointment with the best psychologists from Karachi</a>, Lahore and all other main cities of Pakistan.<br /><img class=\"alignnone size-full wp-image-8677\" src=\"https://i2.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/mom-health-2.jpg?resize=950%2C499&amp;ssl=1\" sizes=\"(max-width: 950px) 100vw, 950px\" srcset=\"https://i2.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/mom-health-2.jpg?w=1200&amp;ssl=1 1200w, https://i2.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/mom-health-2.jpg?resize=400%2C210&amp;ssl=1 400w, https://i2.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/mom-health-2.jpg?resize=300%2C158&amp;ssl=1 300w, https://i2.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/mom-health-2.jpg?resize=768%2C403&amp;ssl=1 768w, https://i2.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/mom-health-2.jpg?resize=1024%2C538&amp;ssl=1 1024w\" alt=\"bonding with new born\" width=\"764\" height=\"401\" data-attachment-id=\"8677\" data-permalink=\"https://www.marham.pk/healthblog/10-essentials-taking-care-yourself-after-c-section/mom-health-2/\" data-orig-file=\"https://i2.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/mom-health-2.jpg?fit=1200%2C630&amp;ssl=1\" data-orig-size=\"1200,630\" data-comments-opened=\"0\" data-image-meta=\"{&quot;aperture&quot;:&quot;0&quot;,&quot;credit&quot;:&quot;&quot;,&quot;camera&quot;:&quot;&quot;,&quot;caption&quot;:&quot;&quot;,&quot;created_timestamp&quot;:&quot;0&quot;,&quot;copyright&quot;:&quot;&quot;,&quot;focal_length&quot;:&quot;0&quot;,&quot;iso&quot;:&quot;0&quot;,&quot;shutter_speed&quot;:&quot;0&quot;,&quot;title&quot;:&quot;&quot;,&quot;orientation&quot;:&quot;0&quot;}\" data-image-title=\"mom-health-2\" data-image-description=\"\" data-medium-file=\"https://i2.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/mom-health-2.jpg?fit=300%2C158&amp;ssl=1\" data-large-file=\"https://i2.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/mom-health-2.jpg?fit=950%2C499&amp;ssl=1\" /></p>\r\n<h3><strong>Things to Avoid:</strong></h3>\r\n<p><strong>1.&nbsp;</strong>Sexual intercourse until your health-care provider gives you a green signal.</p>\r\n<p><strong>2.&nbsp;</strong>Lifting heavy objects and repeatedly using stairs.</p>\r\n<p><strong>3.&nbsp;</strong>Exercise, unless your health-care provider tells you to.</p>\r\n<p><strong>4.&nbsp;</strong>Use of tampons</p>\r\n<p><strong>5.&nbsp;</strong>Taking baths until your incision is healed and there&rsquo;s no more bleeding. Quick showers are best for now.</p>\r\n<p>Taking measures for your health-care is not just necessary for you, but it is also important for your baby. So, don&rsquo;t feel shy or ashamed to discuss your post-pregnancy problems with your partner or a trusted friend. It is very advisable to consult a doctor or a health-specialist for your health concerns.</p>', '1', '2018-04-06 06:38:26', '2018-04-06 06:43:55'),
(5, 2, 'Are You Suffering from Inflammatory Bowel Disease?', 'a9Ac1b3WmC3t3iaJ_IBD-1.jpg', '<p>In order to have a healthy body having fit digestive tract is very significant. Digestive tract consists of mouth, esophagus, abdomen, small and large intestine; a problem in any of these organs can disrupt the function of the whole digestive tract.&nbsp;<strong>Inflammatory Bowel Disease</strong><strong>&nbsp;(IBD)&nbsp;</strong>is an intestinal disorder that causes swelling in the digestive tract that can lead to serious complications.</p>\r\n<p>One needs to identify its signs as early as possible to get it treated right away or before it becomes life-threatening for them. You might need to&nbsp;<a href=\"https://www.marham.pk/doctors/karachi/gastroenterologist\">find and consult with the best gastroenterologist in Karachi</a><strong>,</strong>Lahore&nbsp;or any other main city of Pakistan, to&nbsp;have a proper diagnosis and follow up on IBD. Following are some of the signals that might alarm you because they can be because of IBD:</p>\r\n<ul>\r\n<li>Frequent&nbsp;<a href=\"https://www.marham.pk/healthblog/5-conditions-may-cause-deadly-stomach-cramps/\">pain in the stomach</a></li>\r\n</ul>\r\n<p><img class=\"alignnone size-full wp-image-8573\" src=\"https://i1.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-2-1.jpg?resize=950%2C499&amp;ssl=1\" sizes=\"(max-width: 950px) 100vw, 950px\" srcset=\"https://i1.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-2-1.jpg?w=1200&amp;ssl=1 1200w, https://i1.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-2-1.jpg?resize=400%2C210&amp;ssl=1 400w, https://i1.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-2-1.jpg?resize=300%2C158&amp;ssl=1 300w, https://i1.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-2-1.jpg?resize=768%2C403&amp;ssl=1 768w, https://i1.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-2-1.jpg?resize=1024%2C538&amp;ssl=1 1024w\" alt=\"pain in stomach\" width=\"764\" height=\"401\" data-attachment-id=\"8573\" data-permalink=\"https://www.marham.pk/healthblog/suffering-inflammatory-bowel-disease/ibd-2-2/\" data-orig-file=\"https://i1.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-2-1.jpg?fit=1200%2C630&amp;ssl=1\" data-orig-size=\"1200,630\" data-comments-opened=\"0\" data-image-meta=\"{&quot;aperture&quot;:&quot;0&quot;,&quot;credit&quot;:&quot;&quot;,&quot;camera&quot;:&quot;&quot;,&quot;caption&quot;:&quot;&quot;,&quot;created_timestamp&quot;:&quot;0&quot;,&quot;copyright&quot;:&quot;&quot;,&quot;focal_length&quot;:&quot;0&quot;,&quot;iso&quot;:&quot;0&quot;,&quot;shutter_speed&quot;:&quot;0&quot;,&quot;title&quot;:&quot;&quot;,&quot;orientation&quot;:&quot;0&quot;}\" data-image-title=\"IBD-2\" data-image-description=\"\" data-medium-file=\"https://i1.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-2-1.jpg?fit=300%2C158&amp;ssl=1\" data-large-file=\"https://i1.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-2-1.jpg?fit=950%2C499&amp;ssl=1\" /></p>\r\n<ul>\r\n<li>Pain while discharging waste out of body</li>\r\n<li>Diarrhea</li>\r\n<li>In some cases Pus and Blood in stool</li>\r\n<li>Weight loss</li>\r\n<li>Rapid pulse (Fast heart rate)</li>\r\n</ul>\r\n<p>For people who suffer from IBD it becomes really hard for them to eat properly hence they can become weak internally which make them vulnerable to get viral infections more than a normal healthy person. IBD is curable if diagnosed on time. To get rid of it a patient needs to change his/her lifestyle entirely. Adopting a healthy lifestyle is an option for them to get back to the normal lifestyle. To learn how to improve quality of life and get rid of IBD&nbsp;<a href=\"https://www.marham.pk/doctors/karachi/general-physician\">book an appointment with the best general physician in Karachi</a><strong>,</strong>&nbsp;Lahore or any other main city of Pakistan via Marham.pk.</p>\r\n<h3>Following are simple steps that a person can take to get rid of it:</h3>\r\n<ul>\r\n<li>Eating less spicy food</li>\r\n<li>Eat fiber-rich food that is easily digestible</li>\r\n</ul>\r\n<p><img class=\"alignnone size-full wp-image-8570\" src=\"https://i1.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-4.jpg?resize=950%2C499&amp;ssl=1\" sizes=\"(max-width: 950px) 100vw, 950px\" srcset=\"https://i1.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-4.jpg?w=1200&amp;ssl=1 1200w, https://i1.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-4.jpg?resize=400%2C210&amp;ssl=1 400w, https://i1.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-4.jpg?resize=300%2C158&amp;ssl=1 300w, https://i1.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-4.jpg?resize=768%2C403&amp;ssl=1 768w, https://i1.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-4.jpg?resize=1024%2C538&amp;ssl=1 1024w\" alt=\"intestinal health\" width=\"764\" height=\"401\" data-attachment-id=\"8570\" data-permalink=\"https://www.marham.pk/healthblog/suffering-inflammatory-bowel-disease/ibd-4/\" data-orig-file=\"https://i1.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-4.jpg?fit=1200%2C630&amp;ssl=1\" data-orig-size=\"1200,630\" data-comments-opened=\"0\" data-image-meta=\"{&quot;aperture&quot;:&quot;0&quot;,&quot;credit&quot;:&quot;&quot;,&quot;camera&quot;:&quot;&quot;,&quot;caption&quot;:&quot;&quot;,&quot;created_timestamp&quot;:&quot;0&quot;,&quot;copyright&quot;:&quot;&quot;,&quot;focal_length&quot;:&quot;0&quot;,&quot;iso&quot;:&quot;0&quot;,&quot;shutter_speed&quot;:&quot;0&quot;,&quot;title&quot;:&quot;&quot;,&quot;orientation&quot;:&quot;0&quot;}\" data-image-title=\"IBD-4\" data-image-description=\"\" data-medium-file=\"https://i1.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-4.jpg?fit=300%2C158&amp;ssl=1\" data-large-file=\"https://i1.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-4.jpg?fit=950%2C499&amp;ssl=1\" /></p>\r\n<ul>\r\n<li>A daily walk for at least 30 minutes</li>\r\n<li><a href=\"https://www.marham.pk/healthblog/11-helpful-ways-to-quit-smoking/\">Quit smoking</a>&nbsp;right away.</li>\r\n<li>Taking medication as prescribed by the doctor</li>\r\n</ul>\r\n<p><img class=\"aligncenter size-full wp-image-8571\" src=\"https://i0.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-3.jpg?resize=950%2C499&amp;ssl=1\" sizes=\"(max-width: 950px) 100vw, 950px\" srcset=\"https://i0.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-3.jpg?w=1200&amp;ssl=1 1200w, https://i0.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-3.jpg?resize=400%2C210&amp;ssl=1 400w, https://i0.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-3.jpg?resize=300%2C158&amp;ssl=1 300w, https://i0.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-3.jpg?resize=768%2C403&amp;ssl=1 768w, https://i0.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-3.jpg?resize=1024%2C538&amp;ssl=1 1024w\" alt=\"Digestive health\" width=\"764\" height=\"401\" data-attachment-id=\"8571\" data-permalink=\"https://www.marham.pk/healthblog/suffering-inflammatory-bowel-disease/ibd-3/\" data-orig-file=\"https://i0.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-3.jpg?fit=1200%2C630&amp;ssl=1\" data-orig-size=\"1200,630\" data-comments-opened=\"0\" data-image-meta=\"{&quot;aperture&quot;:&quot;0&quot;,&quot;credit&quot;:&quot;&quot;,&quot;camera&quot;:&quot;&quot;,&quot;caption&quot;:&quot;&quot;,&quot;created_timestamp&quot;:&quot;0&quot;,&quot;copyright&quot;:&quot;&quot;,&quot;focal_length&quot;:&quot;0&quot;,&quot;iso&quot;:&quot;0&quot;,&quot;shutter_speed&quot;:&quot;0&quot;,&quot;title&quot;:&quot;&quot;,&quot;orientation&quot;:&quot;0&quot;}\" data-image-title=\"Digestive health\" data-image-description=\"\" data-medium-file=\"https://i0.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-3.jpg?fit=300%2C158&amp;ssl=1\" data-large-file=\"https://i0.wp.com/www.marham.pk/healthblog/wp-content/uploads/2018/04/IBD-3.jpg?fit=950%2C499&amp;ssl=1\" /></p>\r\n<p>Any sort of disease can make a life a person miserable, indeed health is wealth. Most of the diseases are curable; if they are diagnosed in time, therefore, a person should always keep a check on his/her health and contact the doctor immediately if something seems out of place.</p>', '1', '2018-04-06 06:40:20', '2018-04-06 06:43:55'),
(6, 2, '5 Most Common Causes of Kidney Failure', 'hDkMGQJEposCAbVd_kidney-failure.jpg', '<p>Kidney failure or renal failure is a condition in which your kidneys receive enough damage to lose their function as blood purifiers. Kidney failure can be divided into two categories:</p>\r\n<ul>\r\n<li><strong>Acute renal failure:&nbsp;</strong>In which the kidneys suddenly stop working completely or almost completely. Acute renal failure is reversible and the kidneys may eventually recover near normal functioning with proper treatment and care.</li>\r\n<li><strong>Chronic renal failure:&nbsp;</strong>Which results from the gradual loss of functioning nephrons (cells that make up a kidney). Chronic renal failure develops over time with no initial clinical symptoms. Also, it is irreversible.</li>\r\n</ul>\r\n<p>If proper diagnosis and cure are not given on time, the damage to the kidneys may become permanent and turn into&nbsp;<strong>end-stage renal failure (ESRD).</strong></p>\r\n<h3>5 Commonly Observed Causes of Renal Failure:</h3>\r\n<h2>Diabetes:</h2>\r\n<p>Diabetes mellitus is one of the leading causes of kidney failure. About 30% of the patients with type-1 diabetes and 10-40% of those suffering from type-2 diabetes eventually face kidney failure. Diabetes damages the blood vessels in kidneys thus, they are unable to clean your blood properly. If not treated immediately, the kidney damage may become fatal leading to ESRD. To know if your kidneys are in a healthy state or not&nbsp;<a href=\"https://www.marham.pk/doctors/karachi/nephrologist\">book yourself an appointment with the best Nephrologist in Karachi</a>, Lahore or other main cities via Marham.pk.</p>\r\n<h2>Hypertension:</h2>\r\n<p>The second main cause of renal failure is hypertension. Diabetes and high blood pressure together account for more than 70% of all chronic renal failure. Uncontrolled blood pressure affects the dense network of blood vessels in the kidneys, so they are unable to deliver enough blood to the renal tissues. To address the problem of hypertension&nbsp;<a href=\"https://www.marham.pk/doctors/karachi/cardiology\">consult a good heart specialist in Karachi</a><strong>,</strong>&nbsp;Lahore or other main cities via Marham and keep your blood pressure under control.</p>\r\n<h2>Obesity:</h2>\r\n<p>Gaining excess amount of weight appears to be the prime factor for the two main causes of ESRD &ndash; diabetes, and hypertension. Fat deposits clog the arteries, thereby restricting the flow of blood to the kidneys.</p>\r\n<h2>Chronic Dehydration:</h2>\r\n<p>To filter out the wastes, kidneys need an adequate amount of water. If your body is critically dehydrated, the acid-base balance and electrolyte concentrations of your body are altered causing severe or sometimes irreversible damage to the kidneys.</p>\r\n<h3>Related:&nbsp;<a href=\"https://www.marham.pk/healthblog/5-diseases-causes-kidney-failure/\">5 Diseases That Causes Kidney Failure</a></h3>\r\n<h2>Medication:</h2>\r\n<p>A number of medicinal drugs are toxic to kidneys. Some common examples are:</p>\r\n<ul>\r\n<li>Nonsteroidal anti-inflammatory drugs (NSAIDs) like ibuprofen and naproxen.</li>\r\n<li>Antibiotics like Garamycin and Tobramycin.</li>\r\n<li>Lithium</li>\r\n<li>Iodine-containing medications</li>\r\n</ul>\r\n<p>Renal complications are one of the most frequent situations occurring among people worldwide.&nbsp;It is crucial to seek out immediate treatment concerning your renal health.</p>', '1', '2018-04-06 06:43:42', '2018-04-06 06:43:55');
