INSERT INTO `medical_specialties` (`id`, `parent_id`, `name`, `description`, `created_at`, `updated_at`) VALUES
(1, NULL, 'Cardiology', 'Cardiology is a branch of medicine dealing with disorders of the heart as well as parts of the circulatory system. The field includes medical diagnosis and treatment of congenital heart defects, coronary artery disease, heart failure, valvular heart disease and electrophysiology. Physicians who specialize in this field of medicine are called cardiologists,', '2018-04-05 15:00:41', '2018-04-05 15:00:41'),
(2, NULL, 'Dentistry', 'A person who is qualified to treat diseases and other conditions that affect the teeth and gums, especially the repair and extraction of teeth and the insertion of artificial ones.', '2018-04-05 15:00:41', '2018-04-05 15:00:41'),
(3, NULL, 'Dermatology | Skin Specialists', 'Dermatologist provides the medical treatment related to conditions effecting skin, hair and nails.', '2018-04-05 15:00:41', '2018-04-05 15:00:41'),
(4, NULL, 'Cosmetology', 'Cosmetologist is the beauty expert who takes care of people\'s hair, skin and nails. The word has been derived from Greek word which is related to beautifying.', '2018-04-05 15:00:41', '2018-04-05 15:00:41'),
(5, NULL, 'Otolaryngology | ENT-specialist', 'is the oldest medical specialty in the United States. Otolaryngologists are physicians trained in the medical and surgical management and treatment of patients with diseases and disorders of the ear, nose, throat (ENT), and related structures of the head and neck.', '2018-04-05 15:00:41', '2018-04-05 15:00:41'),
(6, NULL, 'Ophthalmology | Eye Specialists', 'the branch of medicine concerned with the study and treatment of disorders and diseases of the eye.', '2018-04-05 15:00:41', '2018-04-05 15:00:41'),
(7, NULL, 'Nutritionology | Dietetics | Diet Specialists', 'the branch of knowledge concerned with the diet and its effects on health, especially with the practical application of a scientific understanding of nutrition.', '2018-04-05 15:00:41', '2018-04-05 15:00:41'),
(8, NULL, 'Hepatology  | Liver specialist', 'Hepatology is a branch of medicine concerned with the study, prevention, diagnosis and management of diseases that affect the liver, gallbladder, biliary tree and pancreas.', '2018-04-05 15:00:41', '2018-04-05 15:00:41'),
(9, NULL, 'Nephrology', 'The branch of medicine that deals with the physiology and diseases of the kidneys.', '2018-04-05 15:00:41', '2018-04-05 15:00:41'),
(10, NULL, 'Gynecology', 'Gynaecology is the medical practice dealing with the health of the female reproductive systems (vagina, uterus and ovaries) and the breasts. Literally, outside medicine, it means \"the science of women', '2018-04-05 15:00:41', '2018-04-05 15:00:41'),
(11, NULL, 'Family Physician', 'Family physicians care for both genders and all ages. Our comprehensive approach to care is necessary in our health care system.', '2018-04-05 15:00:41', '2018-04-05 15:00:41'),
(12, NULL, 'General Physician', 'In the medical profession, a general practitioner (GP) is a medical doctor who treats acute and chronic illnesses and provides preventive care and health education to patients.', '2018-04-05 15:00:41', '2018-04-05 15:00:41');
