INSERT INTO `qualifications` (`id`, `code`, `title`, `description`, `affiliation`, `created_at`, `updated_at`) VALUES
(1, 'MBBS', 'Bachelor of Medicine', 'MBBS is an abbreviation for Medicinae Baccalaureus, Baccalaureus Chirurgiae, or Bachelor of Medicine, Bachelor of Surgery in English, a primary medical qualification.', NULL, '2018-04-05 15:00:41', '2018-04-05 15:00:41'),
(2, 'Dip-Card', 'Diploma in Cardiology', 'Diploma in Cardiology', NULL, '2018-04-05 15:00:41', '2018-04-05 15:00:41'),
(3, 'BDS', 'Bachelor of Dental Surgery', 'Bachelor of Dental Surgery', NULL, '2018-04-05 15:00:41', '2018-04-05 15:00:41'),
(4, 'RDS', 'Respiratory Distress Syndrome', 'Respiratory Distress Syndrome', NULL, '2018-04-05 15:00:41', '2018-04-05 15:00:41'),
(5, 'PMDS', 'Persistent Mllerian duct syndrome', 'Persistent Mllerian duct syndrome', NULL, '2018-04-05 15:00:41', '2018-04-05 15:00:41'),
(6, 'MCPS', 'Member of College of Physicians & Surgeons', 'Its is Member of College of Physicians and Surgeons Pakistan.\r\n\r\nCollege of Physicians and Surgeons Pakistan is a firm responsible for the registration of Postgraduate Doctors of Pakistan. It makes rules, enrolls doctors and conducts exams for the Post graduation in Pakistan. Currently, CPSP is registering for FCPSI, II and MCPS. CPSP also enrolls foreign qualified doctors.', NULL, '2018-04-05 15:00:41', '2018-04-05 15:00:41'),
(7, 'MPH', 'Master of public health', 'Master of public health, a degree designating successful training in analyzing past, present, and future public health issues.', NULL, '2018-04-05 15:00:41', '2018-04-05 15:00:41'),
(8, 'MSC (Food & Nutrition)', 'Master of Science (Food & Nutrition)', 'Master of Science (Food & Nutrition)', NULL, '2018-04-05 15:00:41', '2018-04-05 15:00:41'),
(9, 'FRCS', 'Fellowship of the Royal College of Surgeons', 'Fellowship of the Royal College of Surgeons (FRCS) is a professional qualification to practise as a senior surgeon in Ireland or the United Kingdom.', NULL, '2018-04-05 15:00:41', '2018-04-05 15:00:41'),
(10, 'MS General Surgery', 'M.S Degree in General Surgery', 'M.S Degree in General Surgery', NULL, '2018-04-05 15:00:41', '2018-04-05 15:00:41'),
(11, 'FCPS', 'Fellowship of the College of Physicians and Surgeons', 'M.S Degree in General Surgery', NULL, '2018-04-05 15:00:41', '2018-04-05 15:00:41'),
(12, 'Fellowship Liver Transplant Surgery', 'Fellowship Liver Transplant Surgery', 'FFellowship Liver Transplant Surgery', NULL, '2018-04-05 15:00:41', '2018-04-05 15:00:41'),
(13, 'Hepatobiliary Surgeon', 'Hepatobiliary Surgeon', 'Hepatobiliary: Having to do with the liver plus the gallbladder, bile ducts, or bile. For example, MRI (magnetic resonance imaging) can be applied to the hepatobiliary system. Hepatobiliary makes sense since \"hepato-\" refers to the liver and \"-biliary\" refers to the gallbladder, bile ducts, or bile.', NULL, '2018-04-05 15:00:41', '2018-04-05 15:00:41'),
(14, 'CPS', 'Cycle per second', 'Cycle per second, now known as hertz, which is the SI unit for frequency. Counts per second and counts per minute are widely used in ionising radiation metrology to signify the rate at which ionising events are detected by a radiological measurement instrument.', NULL, '2018-04-05 15:00:41', '2018-04-05 15:00:41'),
(15, 'MD/DM', 'Doctor of Medicine', 'Doctor of Medicine (MD or DM), or in Latin: Medicinae Doctor, meaning \"teacher of medicine\", is a terminal degree for physicians and surgeons. In countries that follow the tradition of ancient Scotland, it is a first professional graduate degree awarded upon graduation from medical school.', NULL, '2018-04-05 15:00:41', '2018-04-05 15:00:41');
